import Livro from "../Livro/Livro";
import "./Categoria.css";
function Categoria(props) {
  function eventoOUcategoria(){
    if(props.event || props.event != null){
      return(<h1 className="Categoria"> {props.categoria} </h1>)
    }else{
      return(<h1 className="Evento"> {props.categoria} </h1>)
    }
  }
  return (
    <div className="CategoriaDiv">
     {eventoOUcategoria}
      <div className="Livros">
        {props.livro.map((conteudo, i) => {
          if (conteudo !== undefined) {
            return (
                <Livro key={i} livro={conteudo} />
            );
          }else{return(
            <></>
          )}
        })}
      </div>
    </div>
  );
}

export default Categoria;
